import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { Routes, createBrowserRouter } from 'react-router-dom';

<createBrowserRouter>
  <Routes>
    <Route></Route>
  </Routes>
</createBrowserRouter>

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
